    <script>
        var tristan = {}

        tristan.checkbox = function(_anchor, _callback){
            var __this = this
            this.checked = false

            var __anchor = _anchor
            var __callback = _callback

            this.click = function(){
                console.log('clicked')
                __this.checked = !__this.checked

                __this.draw()

                if(_callback){
                    _callback()
                }
            }

            this.draw = function() {
                var anchor = d3.select(_anchor)
                anchor.selectAll('*').remove()

                anchor.append('rect')
                .attr('x','-65')
                .attr('y','-35')
                .attr('width','39')
                .attr('height','39')
                .style('stroke','rgb(191,161,75)')
                .style('stroke-width','5px')
                .style('fill','transparent')
                .style('cursor','pointer')
                .on('click', function(){
                    __this.click()

                })
                
                if(__this.checked){
                    anchor.append('path')
                    .attr('transform','translate(-65,-35)')
                    .style('stroke','black')
                    .style('stroke-width','10px')
                    .style('fill','transparent')
                    .style('pointer-events','none')
                    .attr('d','M 10 15 L 20 25 L 50 -10')
                    
                    anchor.append('path')
                    .attr('transform','translate(-65,-35)')
                    .style('stroke','rgb(191,161,75)')
                    .style('stroke-width','5px')
                    .style('fill','transparent')
                    .style('pointer-events','none')
                    .attr('d','M 10 15 L 20 25 L 50 -10')

                }
            }

            this.draw()

            return this
            
        }
        var checkbox1
        var checkbox2

        var checkbox1_click = function(){
            if(checkbox1.checked){
                checkbox2.checked = false
                checkbox2.draw()
            }

        }
        var checkbox2_click = function(){
            console.log(checkbox2.checked)
            if(checkbox2.checked){
                checkbox1.checked = false
                checkbox1.draw()
            }

        }

        checkbox1 = new tristan.checkbox(d3.select('#checkbox1').node(),checkbox1_click)
        checkbox2 = new tristan.checkbox(d3.select('#checkbox2').node(),checkbox2_click)

        var name_list_inner = d3.select('#g_name_list g')

        console.log(name_list_inner.node())


        name_list_inner.attr('transform','translate(0, -' + ((name_list_inner.node().getBBox().height / 2)) +')')

        // var name_count = name_list.nodes().length

        // name_list.each(function(d){
        //     d3.select(this)

        // })



    </script>
